class Global {
    public static double poly(List<Integer> xs, double x) {
        double res = 0.0;
        for (int i = 0; i < xs.size(); i++) {
            res += xs.get(i) * Math.pow(x, i);
        }
        return res;
    }

    public static double findZero(List<Integer> xs) {
        double x1 = 1.0, x2 = -1.0;
        while (poly(xs, x1) * poly(xs, x2) > 0) {
            x1 *= 2;
            x2 *= 2;
        }
        while (Math.abs(x1 - x2) > 1e-10) {
            double mid = (x1 + x2) / 2;
            if (poly(xs, mid) == 0) {
                return mid;
            } else if (poly(xs, mid) * poly(xs, x1) < 0) {
                x2 = mid;
            } else {
                x1 = mid;
            }
        }
        return (x1 + x2) / 2;
    }
}
