        if (lst.size() < 2) return true;
        for (int i = 1; i < lst.size(); i++) {
            if (lst.get(i - 1) > lst.get(i)) return false;
        }
        HashMap<Integer, Integer> freq = new HashMap<>();
        for (int num : lst) {
            freq.put(num, freq.getOrDefault(num, 0) + 1);
        }
        int maxFreq = Collections.max(freq.values(), Comparator.naturalOrder());
        return maxFreq <= 2;
    }
}
class Global {
    public static String intersection(List<Integer> interval1, List<Integer> interval2) {
        int l = Math.max(interval1.get(0), interval2.get(0));
        int r = Math.min(interval1.get(1), interval2.get(1));
        int length = r - l;
        return isPrime(length) && length > 0 ? "YES" : "NO";
    }

    private static boolean isPrime(int n) {
        if (n < 2) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(n); i++) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }
}
