class Global {
    public static Optional<Integer> prodSigns(List<Integer> arr) {
        if (arr.isEmpty()) {
            return Optional.empty();
        }
        if (arr.contains(0)) {
            return Optional.of(0);
        }
        int sign = arr.stream().filter(n -> n < 0).count() % 2 == 1 ? -1 : 1;
        int sumOfAbs = arr.stream().mapToInt(Math::abs).sum();
        return Optional.of(sign * sumOfAbs);
    }
}
