class Global {
    public static List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        int min_val = n * n + 1;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid.get(i).get(j) == 1) {
                    List<Integer> temp = new ArrayList<>();
                    if (i != 0) {
                        temp.add(grid.get(i - 1).get(j));
                    }
                    if (j != 0) {
                        temp.add(grid.get(i).get(j - 1));
                    }
                    if (i != n - 1) {
                        temp.add(grid.get(i + 1).get(j));
                    }
                    if (j != n - 1) {
                        temp.add(grid.get(i).get(j + 1));
                    }
                    min_val = 0;
                    for (int val : temp) {
                        if (val < min_val) {
                            min_val = val;
                        }
                    }
                }
            }
        }
        List<Integer> result = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            result.add(i % 2 == 0 ? 1 : min_val);
        }
        return result;
    }
}
class Global {
    public static List<Integer> tri(int n) {
        if (n == 0) {
            return Collections.singletonList(1);
        }
        List<Integer> seq = new ArrayList<>(Arrays.asList(1, 3));
        for (int i = 2; i <= n; i++) {
            if (i % 2 == 0) {
                seq.add(i / 2 + 1);
            } else {
                int nextValue = seq.get(i - 1) + seq.get(i - 2) + (i + 3) / 2;
                seq.add(nextValue);
            }
        }
        return seq;
    }
}
class Global {
    public static int digits(int n) {
        String numStr = Integer.toString(n);
        int product = 1;
        boolean hasOddDigit = false;

        for (char c : numStr.toCharArray()) {
            int digit = Character.getNumericValue(c);
            if (digit % 2 == 1) {
                product *= digit;
                hasOddDigit = true;
            }
        }

        return hasOddDigit ? product : 0;
    }
}
class Global {
    public static boolean isNested(String s) {
        List<Integer> openIdx = new ArrayList<>();
        List<Integer> closeIdx = new ArrayList<>();
        for (int i = 0; i < s.length(); i++) {
            char ch = s.charAt(i);
            if (ch == '[') {
                openIdx.add(i);
            } else if (ch == ']') {
                closeIdx.add(i);
            }
        }
        Collections.reverse(closeIdx);
        int cnt = 0;
        int i = 0;
        int l = closeIdx.size();
        for (int idx : openIdx) {
            if (i < l && idx < closeIdx.get(i)) {
                cnt++;
                i++;
            }
        }
        return cnt >= 2;
    }
}
