class Global {
    public static Optional<Double> compareOne(Object a, Object b) {
        double a1 = anyToReal(a);
        double b1 = anyToReal(b);
        if (a1 == b1) {
            return Optional.empty();
        } else if (a1 > b1) {
            return Optional.of(a1);
        } else {
            return Optional.of(b1);
        }
    }

    private static double anyToReal(Object o) {
        if (o instanceof String) {
            return Double.parseDouble(((String) o).replace(',', '.'));
        } else if (o instanceof Integer) {
            return ((Integer) o).doubleValue();
        } else if (o instanceof Double) {
            return (Double) o;
        } else {
            throw new RuntimeException("Type Error");
        }
    }
}
