public class Global {
    public static List<Integer> orderByPoints(List<Integer> nums) {
        return nums.stream()
                .sorted((a, b) -> Integer.compare(digitsSum(a), digitsSum(b)))
                .collect(Collectors.toList());
    }

    private static int digitsSum(int n) {
        String nStr = String.valueOf(n);
        if (n >= 0) {
            return nStr.chars()
                    .map(Character::getNumericValue)
                    .sum();
        } else {
            return Integer.parseInt(nStr.substring(0, 2)) * 2 + digitsSum(Math.abs(n));
        }
    }
}
