class Global {
    public static int doAlgebra(List<String> operators, List<Integer> operands) {
        List<String> ops = new ArrayList<>(operators);
        List<Integer> nums = new ArrayList<>(operands);
        int i = ops.size() - 1;
        while (i >= 0) {
            if (ops.get(i).equals("**")) {
                nums.set(i, (int) Math.pow(nums.get(i), nums.get(i + 1)));
                nums.remove(i + 1);
                ops.remove(i);
            }
            i--;
        }
        i = 0;
        while (i < ops.size()) {
            if (ops.get(i).equals("*")) {
                nums.set(i, nums.get(i) * nums.get(i + 1));
                nums.remove(i + 1);
                ops.remove(i);
                i--;
            } else if (ops.get(i).equals("//")) {
                nums.set(i, nums.get(i) / nums.get(i + 1));
                nums.remove(i + 1);
                ops.remove(i);
                i--;
            }
            i++;
        }
        i = 0;
        while (i < ops.size()) {
            if (ops.get(i).equals("+")) {
                nums.set(i, nums.get(i) + nums.get(i + 1));
                nums.remove(i + 1);
                ops.remove(i);
                i--;
            } else if (ops.get(i).equals("-")) {
                nums.set(i, nums.get(i) - nums.get(i + 1));
                nums.remove(i + 1);
                ops.remove(i);
                i--;
            }
            i++;
        }
        return nums.get(0);
    }
}
class Global {
    public static String solve(String s) {
        if (!s.chars().anyMatch(Character::isLetter)) {
            return new StringBuilder(s).reverse().toString();
        }
        StringBuilder result = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (!Character.isLetter(ch)) {
                result.append(ch);
            } else if (Character.isUpperCase(ch)) {
                result.append(Character.toLowerCase(ch));
            } else if (Character.isLowerCase(ch)) {
                result.append(Character.toUpperCase(ch));
            }
        }
        return result.toString();
    }
}
import java.security.MessageDigest;
import java.security.NoSuchAlgorithmException;
import java.util.Optional;

class Global {
    public static Optional<String> stringToMd5(String txt) {
        if (txt == null || txt.isEmpty()) {
            return Optional.empty();
        }
        try {
            MessageDigest md5Hash = MessageDigest.getInstance("MD5");
            byte[] txtBytes = txt.getBytes();
            md5Hash.update(txtBytes);
            byte[] digest = md5Hash.digest();
            StringBuilder sb = new StringBuilder();
            for (byte b : digest) {
                sb.append(String.format("%02x", b));
            }
            return Optional.of(sb.toString());
        } catch (NoSuchAlgorithmException e) {
            return Optional.empty();
        }
    }
}
class Global {
    public static List<Integer> generateIntegers(int a, int b) {
        int lower = Math.max(2, Math.min(a, b));
        int upper = Math.min(8, Math.max(a, b));
        List<Integer> result = new ArrayList<>();
        for (int i = lower; i <= upper; i++) {
            if (i % 2 == 0) {
                result.add(i);
            }
        }
        return result;
    }
